bool player_collision(Player *player, Point *p) {
        // check if any vertices nd lines across vertices collide with walls
    bool collision = false;


    for (int i = 0; i < 4; i++) {
        int next_i = (i + 1) % 4;

        if (check_line(player->vertices[i].x, player->vertices[i].y, player->vertices[next_i].x, player->vertices[next_i].y, 2,p)) {
            collision = true;
            break;
        }
    }

	for (int i = 4; i < 8; i++) {
        int next_i = ((i + 1) % 4)+4;
        if (check_line(player->vertices[i].x, player->vertices[i].y, player->vertices[next_i].x, player->vertices[next_i].y, 2,p)) {
            collision = true;
            break;
        }
    }

    return collision;
}

void update_vertices_fast(Player *player, double x_offset, double y_offset) {
    for (int i = 0; i < 8; i ++) {
        player->vertices[i].x += x_offset;
        player->vertices[i].y += y_offset;
    }
}

