bool check_line(int x1, int y1, int x2, int y2, int size, Point * p) {
  bool is_steep = abs(y2 - y1) > abs(x2 - x1);
    
    if (is_steep){
        swap(&x1,&y1);
        swap(&x2,&y2);
    }
    if(x1>x2){
        swap(&x1,&x2);
        swap(&y1,&y2);    
    }
    
    int deltax = x2 - x1;
    int deltay = abs(y2 - y1);
    int error = -(deltax / 2);
    int y = y1;
    int y_step;
    
    if (y1 < y2) y_step = 1;
    else if (y2 == y1) y_step = 0;
    else y_step = -1;

    int lineLength = x2;
    bool collision = false;
    // Draw the central line
    for (int i=x1; i< lineLength; i++){
        
        if(is_steep) {
            collision = check_collision(y,i,size,p);
        }
        
        else {
            collision = check_collision(i,y,size,p);
        }

        if (collision) {
            return true;
        }

        error = error + deltay;
        if (error > 0){
            y = y + y_step;
            error = error - deltax;
        }
    }

    return false;
}

void eraseLine(int x1, int y1, int x2, int y2, int thickness){

    bool is_steep = abs(y2 - y1) > abs(x2 - x1);
    
    if (is_steep){
        swap(&x1,&y1);
        swap(&x2,&y2);
    }
    if(x1>x2){
        swap(&x1,&x2);
        swap(&y1,&y2);    
    }
    
    int deltax = x2 - x1;
    int deltay = abs(y2 - y1);
    int error = -(deltax / 2);
    int y = y1;
    int y_step;
    
    if (y1 < y2) y_step = 1;
    else if (y2 == y1) y_step = 0;
    else y_step = -1;

    int lineLength = x2;

    // Draw the central line
    for (int i=x1; i< lineLength; i++){

        int pixel_index1 = (y * 320 + i);
        int pixel_index2 = (i * 320 + y);
        if(is_steep) plot_pixel(y,i,backGround[pixel_index2]);
        else plot_pixel(i,y,backGround[pixel_index1]);
         
        error = error + deltay;
        if (error > 0){
            y = y + y_step;
            error = error - deltax;
        }
    }

    
    for (int t = 1; t <= thickness; t++) {
        int y_offset = t;

        int new_y1 = y1 + y_offset;
        int new_y2 = y2 + y_offset;

        error = -(deltax / 2);
        y = new_y1;

        for (int i = x1; i < lineLength; i++){
            int pixel_index1 = (y * 320 + i);
            int pixel_index2 = (i * 320 + y);
            if(is_steep) plot_pixel(y,i,backGround[pixel_index2]);
            else plot_pixel(i,y,backGround[pixel_index1]);
             
            error = error + deltay;
            if (error > 0){
                y = y + y_step;
                error = error - deltax;
            }
        }

        y_offset = -t;
        new_y1 = y1 + y_offset;
        new_y2 = y2 + y_offset;

        error = -(deltax / 2);
        y = new_y1;

        for (int i = x1; i < lineLength; i++){
            int pixel_index1 = (y * 320 + i);
            int pixel_index2 = (i * 320 + y);
            if(is_steep) plot_pixel(y,i,backGround[pixel_index2]);
            else plot_pixel(i,y,backGround[pixel_index1]);
             
            error = error + deltay;
            if (error > 0){
                y = y + y_step;
                error = error - deltax;
            }
        }
    }
}

