bool inTank(Point *vertices, int N, Point ammo) {
    bool inside = false;
    for (int i = 0; i < N; i++) {
        int prev = (i + N - 1) % N; //previous vertex
        
        // is ammo on verticl line
        bool yedges = (vertices[i].y > ammo.y) != (vertices[prev].y > ammo.y);
        bool yEqual = (vertices[i].y == ammo.y) || (vertices[prev].y == ammo.y);
        
        if (yedges || yEqual) {
            // if it is, count intersections
            float intersectX = (vertices[prev].x - vertices[i].x) * (ammo.y - vertices[i].y) /
                               (vertices[prev].y - vertices[i].y) + vertices[i].x;
            
            // check corner and enge
            if (yEqual && ((ammo.x == vertices[i].x) || (ammo.x == vertices[prev].x))) {
                return true; 
            }
            // 
            if (yEqual && ((ammo.x < vertices[i].x) != (ammo.x < vertices[prev].x))) {
                return true; 
            }
            
            if (ammo.x < intersectX) {
                inside = !inside;
            }
        }
    }

    return inside;
}

