void update_ammo_position(Player *player) {
    Point point;
    Point *p = &point;
    for (int i = 0; i < MAX_AMMO; i++) {
        if (player->ammo[i].time > 0) {
			//check next move
            double nextX = player->ammo[i].x + player->ammo[i].dx;
            double nextY = player->ammo[i].y + player->ammo[i].dy;

            bool xcol = false;
			bool ycol = false;
			
			xcol = check_collision(nextX, player->ammo[i].y, BLOCK,p);
			ycol = check_collision(player->ammo[i].x, nextY, BLOCK,p);
			
						
			if (xcol) {
				player->ammo[i].dx *= -1;
			}		
			if (ycol) {
				player->ammo[i].dy *= -1;
			}
			
			if (!xcol && !ycol) {
				player->ammo[i].y = nextY;
				player->ammo[i].x = nextX;
			}
			else if (!xcol) {
				player->ammo[i].x = nextX;
			}
			else if (!ycol) {
				player->ammo[i].y = nextY;
			}
            if(xcol || ycol){
                bounce_sound = true;
                bounce_sound_counter = 0;
			}
			
            // Increment time and deactivate expired ammo
            player->ammo[i].time++;
            if (player->ammo[i].time > AMMO_DURATION) {
                player->ammo[i].time = 0; // Reset time to deactivate ammo
            }
        }
    }
}


bool check_collision(int x, int y, int size, Point *p) {
	for (int xx = x-size/2; xx < x+size/2; xx++) {
		for (int yy = y-size/2; yy <  y+size/2; yy++) {			
			if (walls[xx][yy]) {
                p->y = yy;
                p->x = xx;
                // draw collision around it
				// plot_pixel(xx, yy, 0xFF);
				return true;
			}
		}
	}

	return false;
}

